import 'ol/ol.css';
import KML from 'ol/format/KML';
import GPX from 'ol/format/GPX';
import Map from 'ol/Map';
import VectorSource from 'ol/source/Vector';
import View from 'ol/View';
import XYZ from 'ol/source/XYZ';
import {Circle as CircleStyle, Fill, Stroke, Style} from 'ol/style';
import {Tile as TileLayer, Vector as VectorLayer} from 'ol/layer';


// ###### Variables NO dinámicas ######
var attributions =
  '<a href="https://www.maptiler.com/copyright/" target="_blank">&copy; MapTiler</a> ' +
  '<a href="https://www.openstreetmap.org/copyright" target="_blank">&copy; OpenStreetMap contributors</a>';

// Tiles (pintado del mapa)
var raster = new TileLayer({
  source: new XYZ({
    attributions: attributions,
    // URL correspondiente al servidor mapTiles alojado en el propio PC
    url: 'http://localhost:8080/styles/klokantech-basic/{z}/{x}/{y}.png',
    maxZoom: 20,
  }),
});

// Estilo de pintado de círculos/líneas/etc. 
// TODO: customizarlo al gusto
var style = {
  'Point': new Style({
    image: new CircleStyle({
      fill: new Fill({
        color: 'rgba(255,255,0,0.4)',
      }),
      radius: 5,
      stroke: new Stroke({
        color: '#ff0',
        width: 1,
      }),
    }),
  }),
  'LineString': new Style({
    stroke: new Stroke({
      color: '#f00',
      width: 3,
    }),
  }),
  'MultiLineString': new Style({
    stroke: new Stroke({
      color: '#0f0',
      width: 3,
    }),
  }),
};

// ###### Variables dinámicas ######
var gpx_files = document.getElementById("gpx_files")
// From Zaratamap
var centerLon = JSON.parse(document.getElementById("center").innerText)[0]
var centerLat = JSON.parse(document.getElementById("center").innerText)[1]
var zoom = document.getElementById("zoom").innerText

// Layers tipo KML 
var vector = new VectorLayer({
  source: new VectorSource({
    url: './data/kml/bidegorris.kml',
    format: new KML(),
  }),
});

var sourceGPX = new VectorSource({
  wrapX: false,
  features: new GPX().readFeatures(gpx_files.innerText)
});

// Layers tipo GPX 
var vector_gpx = new VectorLayer({
  source: sourceGPX,
  style: function (feature) {
    return style[feature.getGeometry().getType()];
  },
});

var vector_gpx2 = new VectorLayer({
  source: new VectorSource({
    url: './data/gpx/diego.gpx',
    format: new GPX(),
  }),
  style: function (feature) {
    return style[feature.getGeometry().getType()];
  },

});

// vector.getSource().addFeatures(GPXfeatures);
// var GPXfeatures = (new onlanguagechange.format.GPX()).readFeatures('Alt_Portsmouth',{featureProjection:'EPSG:3857'});

var map = new Map({
  layers: [raster, vector, vector_gpx, vector_gpx2],
  target: document.getElementById('map'),
  view: new View({
    center: [centerLon, centerLat],
    projection: 'EPSG:3857',
    zoom: zoom,
  }),
});

var displayFeatureInfo = function (pixel) {
  var features = [];
  map.forEachFeatureAtPixel(pixel, function (feature) {
    features.push(feature);
  });
  if (features.length > 0) {
    var info = [];
    var i, ii;
    for (i = 0, ii = features.length; i < ii; ++i) {
      info.push(features[i].get('name'));
    }
    document.getElementById('info').innerHTML = info.join(', ') || '(unknown)';
    map.getTarget().style.cursor = 'pointer';
  } else {
    document.getElementById('info').innerHTML = '&nbsp;';
    map.getTarget().style.cursor = '';
  }
  var loc = window.location.pathname;
  console.log(loc);
};


map.on('pointermove', function (evt) {
  if (evt.dragging) {
    return;
  }
  var pixel = map.getEventPixel(evt.originalEvent);
  displayFeatureInfo(pixel);
});

map.on('click', function (evt) {
  displayFeatureInfo(evt.pixel);
  console.log(vector.getSource().getFormat());
});
